class Solution {

    public static void main(String args[]) {
        Scanner in = new Scanner(System.in);
        int A = in.nextInt();
        int B = in.nextInt();
        int X = in.nextInt();
        ArrayList<Integer> sol = new ArrayList<>();
        for(int i = 1; i <= X; i++){
            if(B%i == 0){
                if(i%A == 0){
                    sol.add(i);
                }
            }
        }
       if (sol.isEmpty()) {
            System.out.println("None");
        } else {
            for (int i = 0; i < sol.size(); i++) {
                if (i > 0) {
                    System.out.print(" ");
                }
                System.out.print(sol.get(i));
            }
            System.out.println();
        }
    }
}

