    int a, b, x;
    vector<int> result;

    cin >> a >> b >> x; cin.ignore();

    for(int i = a; i <= x; i += a)
    {
        if(b % i == 0)
        {
            result.push_back(i);
        }
    }

    if(!result.empty())
    {
        for(int j = 0; j < result.size(); j++)
        {
            cout << result[j];
            if(j < result.size() - 1) cout << " ";
        }
